import React from 'react'
import s from './Dialogs.module.css'
import {NavLink} from 'react-router-dom'

const Item = (props) => {
    return (
        <div className={s.dialog + " " + s.active}>
            <NavLink to ={"/dialogs/"+props.id}>{props.name}</NavLink>
        </div>     
    )
}

const Message = (props) => {
    return (
        <div className={s.dialog}>{props.message}</div>
    )
}
let DialogData = [
    {id: 0, name: "Sergey"},
    {id: 1, name: "Andrey"},
    {id: 2, name: "Grisha"},
    {id: 3, name: "Masha"},
    {id: 4, name: "Dasha"},
]

const Dialogs = (props) => {
    return(
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>

                <Item name={DialogData[0].name} id={DialogData[0].id} />
                <Item name={DialogData[1].name} id={DialogData[1].id} />
                <Item name={DialogData[2].name} id={DialogData[2].id} />
                <Item name={DialogData[3].name} id={DialogData[4].id} />
                <Item name="Katya" id="5" />
            </div>
            <div className={s.messages}>
                <Message message="Hello"/>
                <Message message="How are you?"/>
                <Message message="yo"/>
            </div>
        </div>
    )

}

export default Dialogs
